import UsersList from "../Users/UsersList";
import ReactDOM from "react-dom";


const DeleteUser = (id) => {
    return () => {
      const Delete = userList.filter((user) => user.id !== id);
      setUserList(Delete);
    };
  };
  export default DeleteUser;
